import React from "react";

import styles from "./bigCardMovieInfo.module.css";

const BigCardMovieInfo = ({ name, rating, restriction, genre }) => (
  <div>
    <h2 className={styles.movieName}>Terminator : Dark fate</h2>
    <div className={styles.movieInfo}>
      <span>7.8</span>
      <span className={styles.movieRestriction}>16+</span>
      <span>action, sci-fi</span>
    </div>
  </div>
);

export default BigCardMovieInfo;
